import React from "react";
import { NavLink } from "react-router-dom";
import "./Weather.css";

const Weather = (props) => {
    const { kecamatan, kota, propinsi, id, lat, lon } = props;
    return (
        <div className="weather">
            <div className="card">
                <NavLink to={`/detail/${id}`}>
                    {/* <p className="id">{id}</p> */}
                    <p className="provinsi">Provinsi : {propinsi}</p>
                    <p className="kota">Kota : {kota}</p>
                    <p className="kecamatan">Kecamatan : {kecamatan}</p>
                    {/* <p className="lat">{lat}</p>
                <p className="lon">{lon}</p> */}
                </NavLink>
            </div>
        </div>
    );
};

export default Weather;
